import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

import {
  AvatarWoman,
  AvatarMan,
  SettingTwoIcon,
} from "../../common/icons/icons.jsx";

const FormAddEmployee = () => {
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [street, setStreet] = useState("");
  const [houseNumber, setHouseNumber] = useState("");
  const [city, setCity] = useState("");
  const [postCode, setPostCode] = useState("");
  const [sex, setSex] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confPassword, setConfPassword] = useState("");
  const [role, setRole] = useState("");
  const [status, setStatus] = useState("");
  const [msg, setMsg] = useState("");
  const navigate = useNavigate();

  const saveUser = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/users", {
        name: name,
        surname: surname,
        street: street,
        houseNumber: houseNumber,
        city: city,
        postCode: postCode,
        sex: sex,
        phoneNumber: phoneNumber,
        email: email,
        role: role,
        status: status,
        password: password,
        confPassword: confPassword,
        
      });
      navigate("/users");
    } catch (error) {
      if (error.response) {
        setMsg(error.response.data.msg);
      }
    }
  };



  //   const dispatch = useDispatch();
  //   const navigate = useNavigate();
  //   const { isError
  //   //,user
  //   } = useSelector((state) => state.auth);

  //   useEffect(() => {
  //     dispatch(getMe());
  //   }, [dispatch]);

  //   useEffect(() => {
  //     if (isError) {
  //       navigate("/");
  //     }
  //     // if(user && user.role !== "admin"){
  //     //   navigate("/dashboard");
  //     // }
  //     // opcja dostępu inny niz admin do dashboard
  //   }, [isError,
  //     //user,

  //     navigate]);
  return (
    <div>
      <div className="form-container">
      <div className="form-container-left">
      <div style="display: flex; flex-direction: column; align-items: center;">
  <h2 style="text-align: center;">Witaj na stronie dodawania użytkownika!</h2>
  <p style="text-align: center;">Tutaj możesz w prosty i szybki sposób dodać nowego użytkownika do swojej listy pracowników.</p>
  <p style="text-align: center;">Wypełnij formularz dokładnie i upewnij się, że podajesz poprawne dane, aby nowy użytkownik mógł swobodnie korzystać z systemu.</p>
  <p style="text-align: center;">Jeśli będziesz chciał zmienić dane użytkownika w przyszłości, możesz to zrobić w sekcji "Pracownicy - Edytuj Użytkownika".</p>
  <p style="text-align: center;">Jeśli potrzebujesz pomocy, skorzystaj z naszej sekcji pomocy lub skontaktuj się z naszym zespołem wsparcia.</p>
</div>

      </div>
      <form className="form-template" onSubmit={saveUser}>
        <div className="form-field">
          <label className="form-label">Imie</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={name} onChange={(e) => setName(e.target.value)}placeholder="Name"
            />                                              
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Nazwisko</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={surname} onChange={(e) => setSurname(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Hasło</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={password} onChange={(e) => setPassword(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Powtórz hasło</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={confPassword} onChange={(e) => setConfPassword(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Płeć</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={sex} onChange={(e) => setSex(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Numer domu</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={houseNumber} onChange={(e) => setHouseNumber(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Ulica</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={street} onChange={(e) => setStreet(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
        <div className="form-field">
          <label className="form-label">Miasto</label>
          <div className="form-control">
            <input
              type="text"className="form-input" value={city} onChange={(e) => setCity(e.target.value)}placeholder="Name"
            />
          </div>
        </div>
